import NavBar from 'react'

const Header = () => {
    return (
    <div className='bg-gray-200'>
        <h1>
            <img className='h-24 mx-auto py-4'  src="/logo.png" alt="Logo" height='60'/>
        </h1>
        
    </div>
    )
}

export default Header
